import React from 'react'
import { Grid} from 'semantic-ui-react'

const Recipes = props => (
    <div>
         {props.recipes.map((recipe) => {
        return (
            <Grid key={recipe.recipe_id}>
                <Grid.Row>
                    <Grid.Column>   
                        <p>{recipe.title}</p>
                        <img src={recipe.image_url} alt={recipe.title} />
                    </Grid.Column>
                </Grid.Row>
            </Grid>
        )
      })}
    </div>
)

export default Recipes
